MongoDB - aggregating with nested objects, and changeable keys<p>I have a document which describes counts of different things observed by a camera within a 15 minute period. It looks like this:</p>

<pre><code>{
    "_id" : ObjectId("5b1a709a83552d002516ac19"),
    "start" : ISODate("2018-06-08T11:45:00.000Z"),
    "end" : ISODate("2018-06-08T12:00:00.000Z"),
    "recording" : ObjectId("5b1a654683552d002516ac16"),
    "data" : {
        "counts" : {
            "5b434d05da1f0e00252566be" : 12,
            "5b434d05da1f0e00252566cc" : 4,
            "5b434d05da1f0e00252566ca" : 1
        }
    }
}
</code></pre>

<p>The keys inside the <code>data.counts</code> object <strong>change</strong> with each document and refer to additional data that is fetched at a later date. There are unlimited number of keys inside data.counts (but usually about 20)</p>

<p>I am trying to aggregate all these 15 minute documents up to daily aggregated documents.</p>

<p>I have this query at the moment to do that:</p>

<pre><code>db.getCollection("segments").aggregate([
    {$match:{
       "recording": ObjectId("5bf7f68ad8293a00261dd83f")
    }}, 
    {$project:{
        "start": 1,
        "recording": 1,
        "data": 1
    }},
    {$group:{
        _id: { $dateToString: { format: "%Y-%m-%d", date: "$start" } },
        "segments": { $push: "$$ROOT" }
    }},
    {$sort: {_id: -1}},
]);
</code></pre>

<p>This does the grouping and returns all the <code>segments</code> in an array.</p>

<p>I want to also aggregate the information inside <code>data.counts</code>, so that I get the sum of values for all keys that are the same within the daily group.</p>

<p>This would save me from having another service loop through each 15 minute segment summing values with the same keys. E.g. the query would return something like this:</p>

<pre><code>{
    "_id" : "2019-02-27",
    "counts" : {
        "5b434d05da1f0e00252566be" : 351,
        "5b434d05da1f0e00252566cc" : 194,
        "5b434d05da1f0e00252566ca" : 111
        ... any other keys that were found within a day
    }
}
</code></pre>

<p>How might I amend the query I already have, or use a different query?</p>

<p>Thanks!</p>

