Filter by joined sub-document<p>I am trying to filter a document by a sub-documents referred property. Assume that I have already created models for each schema. The simplified schemas are the following:</p>

<pre><code>const store = new Schema({
    name: { type: String }
})

const price = new Schema({
    price: { type: Number },
    store: {
        type: mongoose.Schema.Types.ObjectId,
        ref: 'Store'
    },
})

const product = new Schema({
    name: {type: String},
    prices: [{
        type: mongoose.Schema.Types.ObjectId,
        ref: 'Price'
    }] 
})
/* 
Notation: 
lowercase for schemas: product
uppercase for models: Product
*/
</code></pre>

<p>As a first approach I tried:</p>

<p><code>Product.find({'prices.store':storeId}).populate('prices')
</code></p>

<p>but this does not work as filtering by a sub-document property is not supported on mongoose. </p>

<p>My current approach is using the aggregation framework. This is how the aggregation looks: </p>

<pre><code>{
  $unwind: '$prices'
},
{
  $lookup: {
    from: 'prices',
    localField: 'prices',
    foreignField: '_id',
    as: 'prices'
  }
},
{
  $unwind: '$prices'
},
{
  $lookup: {
    from: 'stores',
    localField: 'prices.store',
    foreignField: '_id',
    as: 'prices.store'
  }
}, // populate
{
  $match: {
    'prices.store._id': new mongoose.Types.ObjectId(storeId)
  }
}, // filter by store id
{ $group: { _id: '$id', doc: { $first: '$$ROOT' } } },
{ $replaceRoot: { newRoot: '$doc' } }
// Error occurs in $group &amp; $replaceRoot
</code></pre>

<p>For example, before the last two stages if the record being saved is: </p>

<pre><code>{
    name: 'Milk', 
    prices: [
        {store: 1, price: 3.2}, 
        {store: 2, price: 4.0}
    ]
}
</code></pre>

<p>then the aggregation returned: (notice the product is the same but displaying each price in different results)</p>

<pre><code>[ 
    {
        id: 4,
        name: 'Milk', 
        prices: {
           id: 10,
           store: { _id: 1, name : 'Walmart' }, 
           price: 3.2
        }
    },
    {
        id: 4,
        name: 'Milk', 
        prices: {
           id: 11,
           store: { _id: 2, name : 'CVS' }, 
           price: 4.0
        },
    }
]
</code></pre>

<p>To solve this issue I added the last part:</p>

<pre><code>{ $group: { _id: '$id', doc: { $first: '$$ROOT' } } },
{ $replaceRoot: { newRoot: '$doc' } }
</code></pre>

<p>But this last part only returns the following: </p>

<pre><code>{
    id: 4,
    name: 'Milk', 
    prices: {
        id: 10,
        store: { _id: 1, name : 'Walmart' }, 
        price: 3.2
    }
}
</code></pre>

<p>Now <code>prices</code> is an object, it should be an array and it should contain all prices (2 in this case). </p>

<p><strong>Question</strong></p>

<p>How to return all prices (as an array) with the store field populated and filtered by storeId?</p>

<p>Expected result: </p>

<pre><code>{
    id: 4,
    name: 'Milk', 
    prices: [
    {
        id: 10,
        store: { _id: 1, name : 'Walmart' }, 
        price: 3.2
    },
    {
        id: 11,
        store: { _id: 2, name : 'CVS' }, 
        price: 4.0
    }]
}
</code></pre>

<p><strong>EDIT</strong></p>

<p>I want to filter products that contain prices in a given store. It should return the product with its prices, all of them.</p>

